export default function Fetched({ fetchedProps, fetchedValues }) {
	<div className='fetched'>
				<div className='fetched-keys'>
					{fetchedProps.map(i => {
						return(
							<li className='fetched-item' key={i}>{i}:</li>
						)

						})

					}
				</div>
				<div className='fetched-values'>
					{fetchedValues.map(i => {
						return(
							<li className='fetched-item' key={i}>{i}</li>
						)

						})

					}
				</div>
			</div>
}
